package ClassCom9;

public class ClassNestedLoopNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int h = 0; h < 199; h++) {
			for (int m = 0; m < 99; m++) {

				if (m < 10) {
					System.out.println(h + ":00" + m);

				} else {
					System.out.println(h + ":" + m);
				}
	}

}
}}